import React from "react";
import {ProfileWrapper} from "./ProfileCompoent_style";

interface Props {
    username: string;
    description: string;
}


export const ProfileComponent: React.FC<Props> = (Props) => {
    return(

    <ProfileWrapper>
        <div className="container">

                <h2 className="username">Profile Page</h2>
                <p className="description"> Description </p>

        </div>
    </ProfileWrapper>

    );
};

export default ProfileComponent;
